#include<bits/stdc++.h>

bool isAnagram(char* s, char* t) {
    int temp[129] = {0};
    int i = 0;
    int lens = strlen(s);
    int lent = strlen(t);
    if(lens != lent)
    {
        return 0;
    }
    for(i = 0; i < lens; i++)
    {
        temp[s[i]]++;
    }
    for(i = 0; i < lent; i++)
    {
        if(temp[t[i]])
        {
            temp[t[i]]--;
        }
        else
        {
            return 0;
        }
    }
    return 1;
}

int main()
{
    char s[] = "";
    char t[] = "";
    if(isAnagram(s, t))
    {
        printf("1\n");
    }
    else
    {
        printf("0\n");
    }
    return 0;
}